import React, { useState, useContext, useEffect } from 'react';
import { useCommon } from '../../context/commonContext';
import NotificacionesModal from './components/organizacionModal';
import DataTable from 'react-data-table-component';
import DropDownButtonSmall from '../../components/dropdownButtonSmall';
import ModalOrganizacion from './components/organizacionModal';
import { AuthContext } from "../../context/authcontext";
import { apiUrls } from '../../api/apiConfig';
import { deleteWithAuth, getWithAuth } from '../../api/api';
import ConfirmationModal from '../../components/confirmationModal';



const OrganizacionesPage = () => {
    const { getLoggedSession } = useContext(AuthContext);
    const userSession = getLoggedSession();
    const commonContext = useCommon();
    const [searchQuery, setSearchQuery] = useState('');
    const [isLoading, setIsLoading] = useState(true);



    const [organizacionesData, setOrganizacionesData] = useState([

    ]);

    const paginationOptions = {
        rowsPerPageText: 'Elementos por página:',
        rangeSeparatorText: 'de',
        noRowsPerPage: false,
        selectAllRowsItem: true,
        selectAllRowsItemText: 'Todos',
    };
    const CustomLoader = () => <div>Cargando datos...</div>;
    const NoDataComponent = () => <div>No hay datos para mostrar, lo sentimos mucho</div>;


    const [filteredOrganizacionesData, setFilteredOrganizacionesData] = useState(organizacionesData);

    const handleSearchInputChange = (event) => {
        const text = event.target.value;
        setSearchQuery(text);
        const filtered = text === "" ? organizacionesData : organizacionesData.filter(
            (customer) =>
                customer.company_name.toLowerCase().includes(text.toLowerCase())
        );
        setFilteredOrganizacionesData(filtered);
    };

    const deleteOrg = (idOrg) => {
        const fetchData = async () => {
            setIsLoading(true);
            try {
                const data = await deleteWithAuth(
                    apiUrls.organizations.delete(idOrg),
                    userSession
                );
                if (d)
                    commonContext.setConfirmationModal(false);
            } catch (error) {
                /*  ctx.setMessage("Ha ocurrido un error conectando con el servidor");
                 ctx.setAlertType("danger");
                 ctx.openAlertHeader(); */
                console.error("Error getting cards:", error);
            } finally {
                setIsLoading(false);
            }
        };
        fetchData();
    };

    useEffect(() => {
        const fetchData = async () => {
            setIsLoading(true);
            try {
                const data = await getWithAuth(
                    apiUrls.organizations.list,
                    userSession
                );
                setOrganizacionesData(data.results);
            } catch (error) {
                /*  ctx.setMessage("Ha ocurrido un error conectando con el servidor");
                 ctx.setAlertType("danger");
                 ctx.openAlertHeader(); */
                console.error("Error getting cards:", error);
            } finally {
                setIsLoading(false);
            }
        };
        fetchData();
    }, [commonContext.apiSuccess]);

    return (
        <div className='w-100'>
            <div id="kt_app_toolbar" className="app-toolbar">

                <div id="kt_app_toolbar_container" className="app-container container-fluid d-flex flex-stack">

                    <div className="page-title d-flex flex-column justify-content-center me-3 mb-6 mb-lg-0">

                        <h1 className="page-heading d-flex text-gray-900 fw-bold fs-3 flex-column justify-content-center me-3 my-0 title__heading_bold" >Organizaciones</h1>


                        <ul className="breadcrumb breadcrumb-separatorless fw-semibold fs-7 my-0 pt-1">

                            <span className='title__muted_grey'>Gestiona las organizaciones y sus respectivos usuarios  </span>

                        </ul>

                    </div>


                    <div className="d-flex align-items-center gap-2 gap-lg-3">

                        <div className="d-flex align-center">
                            <a href="#!" onClick={() => commonContext.openshowNewModal()} className="btn btn-dark-figma d-flex flex-center flex-shrink-0 ms-4 h-40px text-white" data-bs-toggle="modal" data-bs-target="#kt_modal_create_project">
                                <svg width="16" height="15" viewBox="0 0 16 15" fill="none" xmlns="http://www.w3.org/2000/svg">
                                    <path d="M10.0002 7.5H8.00016M8.00016 7.5H6.00016M8.00016 7.5V5.5M8.00016 7.5V9.5M4.66683 1.72534C5.67984 1.13927 6.82983 0.831533 8.00016 0.833336C11.6822 0.833336 14.6668 3.818 14.6668 7.5C14.6668 11.182 11.6822 14.1667 8.00016 14.1667C4.31816 14.1667 1.3335 11.182 1.3335 7.5C1.3335 6.286 1.65816 5.14667 2.2255 4.16667" stroke="white" stroke-linecap="round" />
                                </svg>
                                Crear nueva organización</a>
                        </div>

                    </div>

                </div>

            </div>

            <div className="mt-15">

                <div id="kt_app_content" className="app-content flex-column-fluid">

                    <div id="kt_app_content_container" className="app-container container-fluid">
                        <div className="col-xl-12 mb-5 mb-xl-12">

                            <div className="flex-lg-row-fluid">


                                <div className="card card-flush">
                                    <div className="card-header align-items-center flex-end py-5 gap-2 gap-md-5">



                                        <div className="position-relative my-1">
                                            <i className="ki-outline ki-magnifier fs-2 position-absolute top-50 translate-middle-y ms-4"></i>
                                            <input type="text" data-kt-table-widget-4="search" className="form-control w-300px fs-7 ps-12" value={searchQuery} onChange={handleSearchInputChange} placeholder="Buscar..." />
                                        </div>
                                    </div>

                                    <div className="card-body p-0" >
                                        <div className="mt-10">
                                            <div className="dataTables_wrapper no-footer">
                                                <div className="table-responsive">
                                                    <DataTable
                                                        columns={[
                                                            {
                                                                name: "NOMBRE",
                                                                selector: row => row.company_name,
                                                                sortable: true,

                                                            },
                                                            {
                                                                name: "LIMITE DE CONTRATOS",
                                                                selector: row => (
                                                                    <span className={row.contratos_creados < row.contracts_limit ? 'text-success' : 'text-danger'}>
                                                                        {row.contracts_limit}
                                                                    </span>
                                                                ),
                                                                sortable: true
                                                            },
                                                            {
                                                                name: "Nº DE CONTRATOS", selector: row => row.contratos_creados, sortable: true
                                                            },
                                                            {
                                                                name: "LIMITE DE USUARIOS",
                                                                selector: row => (
                                                                    <span className={row.usuarios_creados < row.users_limit ? 'text-success' : 'text-danger'}>
                                                                        {row.users_limit}
                                                                    </span>
                                                                ),
                                                                sortable: true
                                                            },
                                                            {
                                                                name: "Nº DE USUARIOS", selector: row => row.usuarios_creados, sortable: true
                                                            },
                                                            {
                                                                //BOTON DE ACCION SIN TITULO EN LA TABLA
                                                                name: "",
                                                                cell: (row) => (
                                                                    <>
                                                                        <DropDownButtonSmall
                                                                            editar={() => {
                                                                                commonContext.openEditModal(row);
                                                                            }}
                                                                            eliminar={() => {
                                                                                commonContext.setSelectedObject(row);
                                                                                commonContext.setConfirmationModal(true);
                                                                            }}

                                                                        />
                                                                        {'     '}
                                                                    </>
                                                                ),
                                                                ignoreRowClick: true,

                                                                maxWidth: "150px",
                                                                minWidth: "50px",
                                                            }
                                                        ]}
                                                        data={searchQuery !== '' ? filteredOrganizacionesData : organizacionesData}
                                                        highlightOnHover={true}
                                                        responsive={true}
                                                        progressPending={isLoading}
                                                        customStyles={{
                                                            rows: {
                                                                style: {
                                                                    minHeight: '72px',
                                                                    color: 'var(--Gris, #8C8E8F)',
                                                                    fontFamily: 'Lexend',
                                                                    fontSize: '14px',
                                                                    fontStyle: 'normal',
                                                                    fontWeight: 500,
                                                                    lineHeight: '25px',
                                                                },
                                                            },
                                                            headCells: {
                                                                style: {
                                                                    paddingLeft: '8px',
                                                                    paddingRight: '8px',
                                                                },
                                                            },
                                                            cells: {
                                                                style: {
                                                                    paddingLeft: '8px',
                                                                    paddingRight: '8px',
                                                                },
                                                            },
                                                            tableWrapper: {
                                                                style: {
                                                                    minHeight: '50vh'
                                                                }
                                                            }
                                                        }}
                                                        pagination
